import React, { useState } from "react";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header style={styles.header}>
      <nav style={styles.nav}>
        {/* Logo */}
        <div style={styles.logo}>MyBrand</div>

        {/* Navigation Links */}
        <ul style={{ ...styles.navLinks, ...(isOpen ? styles.navOpen : {}) }}>
          <li style={styles.navItem}>
            <a href="#home" style={styles.navLink}>
              Home
            </a>
          </li>
          <li style={styles.navItem}>
            <a href="#about" style={styles.navLink}>
              About
            </a>
          </li>
          <li style={styles.navItem}>
            <a href="#services" style={styles.navLink}>
              Services
            </a>
          </li>
          <li style={styles.navItem}>
            <a href="#contact" style={styles.navLink}>
              Contact
            </a>
          </li>
        </ul>

        {/* Toggle Menu Button */}
        <div style={styles.menuIcon} onClick={toggleMenu}>
          <div style={styles.bar}></div>
          <div style={styles.bar}></div>
          <div style={styles.bar}></div>
        </div>
      </nav>
    </header>
  );
};

// Styles for the Navbar
const styles = {
  header: {
    backgroundColor: "linear-gradient(135deg, #6a11cb, #2575fc)",
    boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
    padding: "10px 20px",
    position: "sticky",
    top: 0,
    zIndex: 1000,
  },
  nav: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    maxWidth: "1200px",
    margin: "0 auto",
  },
  logo: {
    fontSize: "24px",
    fontWeight: "bold",
    color: "#fff",
    cursor: "pointer",
  },
  navLinks: {
    display: "flex",
    gap: "20px",
    listStyle: "none",
    transition: "transform 0.3s ease",
  },
  navOpen: {
    transform: "translateX(0)",
  },
  navItem: {
    position: "relative",
  },
  navLink: {
    textDecoration: "none",
    color: "#fff",
    fontSize: "18px",
    fontWeight: "500",
    padding: "5px 10px",
    position: "relative",
    overflow: "hidden",
  },
  navLinkHover: {
    color: "#ffb6c1",
  },
  menuIcon: {
    display: "none",
    flexDirection: "column",
    justifyContent: "space-between",
    height: "20px",
    cursor: "pointer",
  },
  bar: {
    width: "25px",
    height: "3px",
    backgroundColor: "#fff",
    borderRadius: "2px",
    transition: "all 0.3s ease",
  },
};

export default Navbar;
